import React, { useState }  from 'react';
import "../../styles/Register.css";
import { useParams } from 'react-router-dom';

const AddClinic = () => {
  const {doctorUserId} = useParams();
  const [name, setName] = useState('');
  const [address, setAddress] = useState('');
  const [officeNumber, setOfficeNumber] = useState('');
  const [officeEmail, setOfficeEmail] = useState('');
  const [hospital, setHospital] = useState('');
  const [addClinicMessage, setAddClinicMessage] = useState('');
  const [registrationSuccessful, setRegistrationSuccessful] = useState(false);
  const [startTime, setStartTime] = useState('');
  const [endTime, setEndTime] = useState('');
  const [scheduleDay, setScheduleDay] = useState('');
  const [slots, setSlots] = useState('');
  const [addScheduleMessage, setAddScheduleMessage] = useState('');
  const [daysChecked, setDaysChecked] = useState([]);
  const [scheduleEntries, setScheduleEntries] = useState([]);

  if (daysChecked.length === 0) {
    setAddClinicMessage('Please select at least one day for the schedule.');
    return;
  }

  // Create schedule entries based on selected checkboxes
  const newScheduleEntries = daysChecked.map((day) => {
    return {
      doctorUserId,
      scheduleDay: day,
      startTime: '08:00:00', // Default start time
      endTime: '10:00:00', // Default end time
    };
  });

  const handleDayCheckboxChange = (event, day) => {
    const isChecked = event.target.checked;

    if (isChecked) {
      setDaysChecked((prevChecked) => [...prevChecked, day]);
      setScheduleEntries((prevEntries) => [
        ...prevEntries,
        {
          scheduleDay: day,
          startTime: '08:00:00',
          endTime: '10:00:00', // Default end time
        },
      ]);
    } else {
      setDaysChecked((prevChecked) => prevChecked.filter((checkedDay) => checkedDay !== day));
      setScheduleEntries((prevEntries) => prevEntries.filter((entry) => entry.scheduleDay !== day));
    }
  };

  const handleTimeChange = (event, day, timeType) => {
    const selectedTime = event.target.value;

    // Find the schedule entry for the selected day
    const updatedScheduleEntries = scheduleEntries.map((entry) => {
      if (entry.scheduleDay === day) {
        if (timeType === 'start') {
          entry.startTime = selectedTime;
        } else if (timeType === 'end') {
          entry.endTime = selectedTime;
        }
      }
      return entry;
    });

    setScheduleEntries(updatedScheduleEntries);
  };

  const handleAddClinic = async () => {
    // Check if any of the fields are empty
    if (
      !name ||
      !address ||
      !officeNumber ||
      !officeEmail
    ) {
      setAddClinicMessage('Please fill in all required fields.');
      return;
    }

    const officeNumberRegex = /^\d{11}$/;
    if (!officeNumberRegex.test(officeNumber)) {
      setAddClinicMessage('Contact number should be exactly 11 digits and contain only numbers (0-9).');
      return;
    }

    // Validate email format using regular expression
    const officeEmailRegex = /^\w+([.-]?\w+)*@\w+([.-]?\w+)*(\.\w{2,3})+$/;
    if (!officeEmailRegex.test(officeEmail)) {
      setAddClinicMessage('Invalid email format.');
      return;
    }

    try {
      const url = new URL('http://localhost:8080/clinic');
      const userData = {
        name,
        address,
        officeNumber,
        officeEmail,
        hospital,
      };


      const response = await fetch(url, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(userData),
      });

      if (response.ok) {
        // Signup successful
        setAddClinicMessage('Clinic added successfully');
        setRegistrationSuccessful(true);


      } else {
        // Signup failed
        const errorMessage = await response.text();
        setAddClinicMessage(errorMessage);
        setAddClinicMessage(`Signup failed`);
        // Handle the error or display an error message to the user
      }
    } catch (error) {
      console.error('Error during signup:', error);
      setAddClinicMessage('Error during signup. Please try again later.');
      // Handle the error or display an error message to the user
    }
  }

  const handleAddSchedule = async () => {
    // Check if any of the fields are empty
    const queryString = `name=${name}&doctorUserId=${doctorUserId}&scheduleDay=${scheduleDay}&startTime=${startTime}&endTime=${endTime}&slots=${slots}`;

    try {
      const response = await fetch(`http://localhost:8080/schedule?${queryString}`, {
        method: 'POST',
      });

      if (response.ok) {
        // Schedule added successfully
        setAddScheduleMessage('Schedule added successfully');
        // You can add additional handling here if needed
      } else {
        // Schedule addition failed
        const errorMessage = await response.text();
        setAddScheduleMessage(`Schedule addition failed: ${errorMessage}`);
        // Handle the error or display an error message to the user
      }
    } catch (error) {
      console.error('Error during schedule addition:', error);
      setAddScheduleMessage('Error during schedule addition. Please try again later.');
      // Handle the error or display an error message to the user
    }
  };


  return (
    <div className="reg-container" id="reg-container">
      <div className="register">
        <h1 style={{ color: '#0094d4' }}>Add Clinic</h1>
        <form action="#" id="register-form">
            <div className="reg-infield">              
                <input type="text"
                  id="name"
                  placeholder="*Clinic Name"
                  name="name"
                  value={name}
                  onChange={(e) => setName(e.target.value)}
                />
            </div>
            <div className="reg-infield">          
                <input type="text"
                  id="address"
                  placeholder="*(House/Lot/Unit No., Street, Barangay, City/Town, Province)"
                  name="address"
                  value={address}
                  onChange={(e) => setAddress(e.target.value)}
                />
          </div>
            <div className="reg-infield">
              <input type="text"
                  id="officeNumber"
                  placeholder="*Office Number"
                  name="officeNumber"
                  value={officeNumber}
                  onChange={(e) => setOfficeNumber(e.target.value)}
                />
            </div>
            <div className="reg-infield">
              <input type="text"
                  id="officeEmail"
                  placeholder="*Office Email"
                  name="officeEmail"
                  value={officeEmail}
                  onChange={(e) => setOfficeEmail(e.target.value)}
                />
          </div>
          <div className="reg-infield">              
              <input type="text"
                  id="hospital"
                  placeholder="Hospital Affiliation"
                  name="hospital"
                  value={hospital}
                  onChange={(e) => setHospital(e.target.value)}
                />
            </div>
            <div className='reg-row'>
                <div className='reg-infield'>
                    <h4 style={{ marginBottom: '-20px' }}>*Schedule: </h4>
                    <p style={{ marginBottom: '-5px' }}>Select all that applies</p>
                </div>
              </div>
            <div className='reg-row'>
                <div className='reg-infield'>
                <table width={500}>
      {['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday', 'Sunday'].map((day) => (
        <tr key={day} name={`${day.toLowerCase()}Row`}>
          <td width={25}>
            <input
              type="checkbox"
              name={`${day.toLowerCase()}Checkbox`}
              onChange={(event) => handleDayCheckboxChange(event, day)}
            />
          </td>
          <td width={200}>{day}</td>
          {daysChecked.includes(day) && (
            <>
              <td width={50}>Time: </td>
              <td>
                <select
                  name={`${day.toLowerCase()}StartTime`}
                  id={`${day.toLowerCase()}StartTime`}
                  onChange={(event) => handleTimeChange(event, day, 'start')}
                >
                  <option value="08:00:00">8:00 AM</option>
                  <option value="09:00:00">9:00 AM</option>
                  <option value="10:00:00">10:00 AM</option>
                  <option value="11:00:00">11:00 AM</option>
                  <option value="12:00:00">12:00 PM</option>
                  <option value="13:00:00">1:00 PM</option>
                  <option value="14:00:00">2:00 PM</option>
                  <option value="15:00:00">3:00 PM</option>
                  <option value="16:00:00">4:00 PM</option>
                  <option value="17:00:00">5:00 PM</option>
                </select>
              </td>
              <td width={0}>to</td>
              <td>
                <select
                  name={`${day.toLowerCase()}EndTime`}
                  id={`${day.toLowerCase()}EndTime`}
                  onChange={(event) => handleTimeChange(event, day, 'end')}
                >
                  <option value="08:00:00">8:00 AM</option>
                  <option value="09:00:00">9:00 AM</option>
                  <option value="10:00:00">10:00 AM</option>
                  <option value="11:00:00">11:00 AM</option>
                  <option value="12:00:00">12:00 PM</option>
                  <option value="13:00:00">1:00 PM</option>
                  <option value="14:00:00">2:00 PM</option>
                  <option value="15:00:00">3:00 PM</option>
                  <option value="16:00:00">4:00 PM</option>
                  <option value="17:00:00">5:00 PM</option>
                </select>
              </td>
            </>
          )}
        </tr>
      ))}
                  </table>
                </div>
            </div>
        </form>
        <button type="button" onClick={handleAddClinic}>Register</button>
        {addClinicMessage && <p className="signup-message">{addClinicMessage}</p>}
      </div>
    </div>
  );
};

export default AddClinic;
